set charset utf8;
DROP TABLE IF EXISTS `member_auth`;
CREATE TABLE `member_auth` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `member_id` int(10) unsigned NOT NULL COMMENT '用户ID',
  `name` varchar(60) NOT NULL COMMENT '名称',
  `idcard_no` varchar(60) NOT NULL COMMENT '身份证号',
  `img_1` varchar(60) NOT NULL COMMENT '身份证正面',
  `img_2` varchar(60) NOT NULL COMMENT '营业执照号',
  `dateline` int(10) unsigned NOT NULL COMMENT '日期',
  `status` tinyint(1) NOT NULL COMMENT '状态(0:未提交;1:待审核;2:审核通过)',
  PRIMARY KEY (`id`),
  KEY `member_id` (`member_id`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `member_group`;
CREATE TABLE `member_group` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `group_name` varchar(30) NOT NULL COMMENT '等级名',
  `condition_point` text NOT NULL COMMENT '积分条件',
  `condition_consumption` varchar(255) NOT NULL COMMENT '消费条件',
  `ratio` decimal(2,2) unsigned NOT NULL COMMENT '分红比例',
  `setting` text NOT NULL COMMENT '其他设置',
  `status` tinyint(1) unsigned NOT NULL COMMENT '状态(-1:删除;1:有效)',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `member_profile`;
CREATE TABLE `member_profile` (
  `member_id` int(10) unsigned NOT NULL,
  `avatar` text NOT NULL,
  `member_name` varchar(60) NOT NULL,
  `seller_name` varchar(60) NOT NULL,
  `alias` varchar(30) NOT NULL,
  `sex` tinyint(1) unsigned NOT NULL,
  `mobile` varchar(60) NOT NULL,
  `telephone` varchar(60) NOT NULL,
  `company` varchar(60) NOT NULL,
  `province_id` mediumint(8) unsigned NOT NULL,
  `city_id` mediumint(8) unsigned NOT NULL,
  `county_id` mediumint(8) unsigned NOT NULL,
  `address` varchar(255) NOT NULL,
  `memo` varchar(255) NOT NULL,
  PRIMARY KEY (`member_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
